import Header from './components/Header/Header';
import Home from './components/Home/Home';
import Footer from './components/Footer/Footer';
import ScrollTop from './components/ScrollTop/ScrollTop';


function App() {
  return (
    <div className="App">
      <Header />
      <Home /> 
      <Footer />
      <ScrollTop/>
    </div>
  );
}

export default App;
